import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <p className="intro-text">I'm a freelancer who enjoys working on projects</p>
      <h1 className="fullstack">Fullstack</h1>
      <h2 className="webdeveloper">Webdeveloper</h2>
      <div className="image-container">
        <img src="path_to_your_image.jpg" alt="Developer" className="developer-image" />
      </div>
      <div className="button-container">
        <button className="download-btn">Download Resume</button>
        <button className="hire-btn">Hire Me</button>
      </div>
    </div>
  );
};

export default Home;
